import React from 'react';
import IconCarouselRightArrow from "../../Assets/IconCarouselRightArrow.svg";


function RightArrow(){
  return(
    <button>
    <img alt="Right Arrow" src={IconCarouselRightArrow} style={{position: "absolute", right: "20px", bottom: "5px"}}/>
    </button>  
  )
}

export default RightArrow;
